import React from 'react'
import styled from 'styled-components'

const PanelElem = styled.div``

function TabPanel ({children, index, active}) {
    return(
        <PanelElem
            index={index}
            active={active}
        >
            {children}
        </PanelElem>
    )
}

export default TabPanel
